insert into Singers values('03-07-1998', 1, 'https://photo-resize-zmp3.zadn.vn/w240_r1x1_jpeg/avatars/1/1/9/1/1191ee7f27ee31c12ded59649ca87cc7.jpg', N'Huỳnh Minh Tâm', 'Lee Ken',N'Anh được biết đến với những bài rap mang màu sắc và âm hưởng miền tây. Không ngừng cố gắng đến hiện tại Lee Ken đã duy trì được chỗ đứng của mình trong lòng khán giả với những sáng tác rap đậm chất miền tây.')
insert into Singers values('03-8-1995', 1, 'https://photo-resize-zmp3.zadn.vn/w240_r1x1_jpeg/avatars/7/9/2/d/792dbf0b8f85c92e6dc9570caf7525f8.jpg', N'Hồ Phi Nal', 'Nal',N'Anh được biết đến với những bài hát mang màu sắc và âm hưởng miền tây. Không ngừng cố gắng đến hiện tại Nal đã duy trì được chỗ đứng của mình trong lòng khán giả.')
insert into Singers values('09-12-2000', 1, 'https://photo-resize-zmp3.zadn.vn/w240_r1x1_jpeg/avatars/f/9/6/0/f9607b88c70f63f133aca52353c2ef9d.jpg', N'Nguyễn Tấn Đạt', 'DatKaa',N'Anh là một nam ca sĩ điển trai và rất tài năng. Anh từng được đông đảo mọi người trong cộng đồng mạng quan tâm bởi những video hài hước đang tải trên kênh youtube cá nhân. Tính đến thời điểm hiện tại, kênh youtube cá nhân của Tấn Đạt đã thu hút gần 150 nghìn lượt đăng ký kênh với gần 25 triệu lượt xem cùng trang facebook cá nhân cũng thu hút gần 70 nghìn lượt theo dõi.')
insert into Singers values('01-30-1990', 1, 'https://photo-resize-zmp3.zadn.vn/w240_r1x1_jpeg/avatars/1/1/9/1/1191ee7f27ee31c12ded59649ca87cc7.jpg', N'Lê Bảo Bình',N'Lê Bảo Bình',N'Lê Bảo Bình sinh năm 1990 ở Hà Nội được biết đến là một ca sĩ , nhạc sĩ không còn xa lạ gì với giới trẻ Việt Nam anh đang là cái tên gây sốt trong cộng đồng mạng với loạt ca khúc nói về gia đình, cha mẹ, những người tha hương xa nhà rất nhiều ý nghĩa. Hiện tại Lê Bảo Bình có khá nhiều ca khúc Hot do chính anh sáng tác được đông đảo người hâm mộ yêu thích như: Hỏi Thăm Nhau , Người Phản Bội , Yêu Vội Vàng , Kết Thúc Lâu Rồi ,Để Cho Anh Khóc , Chẳng Bao Giờ Quên , Tập Cô Đơn ....')
insert into Singers values('03-05-1992', 0, 'https://photo-resize-zmp3.zadn.vn/w240_r1x1_jpeg/avatars/0/7/2/6/07265c8332ab47e1bbab1515cbbfcf16.jpg', N'Võ Thị Thương', N'Thương Võ',N'Thương Võ là một cái tên mới trong làng giải trí , cô đã tốt nghiệp chuyên nghành thanh nhạc tại trường Đại học văn hóa nghệ thuật quân đội Hà Nội , hiện là ca sĩ tự do và sống tại Hà Nội , cô sinh ra và lớn lên tại mảnh đất Nghệ An , gia đình không có ai làm nghệ thuật nhưng cô đã bén duyên với con đường âm nhạc bằng sự đam mê của mình')
insert into Singers values('12-07-1995', 1, 'https://photo-resize-zmp3.zadn.vn/w240_r1x1_jpeg/avatars/2/b/6/2/2b62681eb5f225949b1a3f2ed54c837f.jpg', N'Cao Thiên Tú', N'Thiên Tú',N'Chọn thời điểm năm 2008 để ra mắt giọng ca của mình, ca sĩ trẻ Cao Thiên Tú gửi đến khán giả những tâm sự về cuộc sống của mình qua album đầu tay Biết thế thì...Đây là album mà Cao Thiên Tú mất hơn hai năm để chuẩn bị thu âm và hoàn thành với sự giúp đỡ về chuyên môn của nhạc sĩ Minh Khang')
